(1, 'About Us', 'about_us', '', 'Flipbites is an online Food Ordering Platform, which firmly believes in the philosophy of customer Flipbites is an online Food Ordering Platform, which firmly believes in the philosophy of customer Flipbites is an online Food Ordering Platform, which firmly believes in the philosophy of customer Flipbites is an online Food Ordering Platform, which firmly believes in the philosophy of customer Flipbites is an online Food Ordering Platform, which firmly believes in the philosophy of customer Flipbites is an online Food Ordering Platform, which firmly believes in the philosophy of customer', 'Publish', '2013-04-19 13:53:16', '2015-10-13 13:56:38', '', ''),
(2, 'Contact Us', 'contact_us', '', '<section class=\"services\">  <h3>Contact our customer service</h3>  <p><span>Email us:</span><a href=\"mailto:customercare@flipbites.com\">support@flipbites.com</a></p>  <p>Problem or Question ? Call us:0124-4066655</p>  <p>Digi Labs Online Services Pvt. Ltd. 327, Centrum Plaza, Sector 53<br>Gurgaon, Haryana-122001, India | Corporate Office</p><h3>You are a restaurant?</h3><p>Do you want yourself listed on flipbites?</p><p>    You can register yourself for listing and we will contact you:<a href=\"http://flipbites.com/beta/logins/register_partner\"> Partner with us</a><br>Are you already our partner and have questions regarding our service?<br>    You can always send an email to: <a href=\"mailto:vendors@flipbites.com\">support@flipbites.com</a></p></section>', 'Publish', '2013-04-24 18:29:58', '2015-10-13 15:43:33', '', ''),
(3, 'Terms & Conditions', 'terms_and_conditions', '', '<p>Terms and Conditions</p><p>Please read the terms and conditions (\"Terms and Conditions\") set out below carefully before ordering any Goods or Services from this Website. By ordering any Goods or Services from this Website, by phone, or by our mobile applications you agree to be bound by these Terms and Conditions.</p><p>&nbsp;</p><p>Section 1: Introduction We are Flipbites, a brand of DIGI EDGE ONLINE SERVICES PRIVATE LIMITED, unless otherwise stated.</p><p><br></p><p>Section 2: Definitions</p><p>2.1. \"Agreement\" is a reference to these Terms and Conditions, the Privacy Policy, any order form and payment instructions provided to you;</p><p>2.2. \"Privacy Policy\" means the policy displayed on our Website which details how we collect and store your personal data;</p><p>2.3. \"you\", \"your\" and \"yours\" are references to you the person accessing this Website and ordering any Goods or Services from the Website or from any other channel provided by flipbites;</p><p>2.4. \"we\", \"us\", \"our\", and \"fliobites\" are references to the Company;</p><p>2.5. \"Goods\" is a reference to any goods which we may offer for sale from our Website from time to time;</p><p>2.6. \"Service\" or \"Services\" is a reference to any service which we may supply and which you may request via our Website;</p><p>2.7. \"Participating Restaurant\" is a third party, which has agreed to co-operate with the Company to prepare and/or deliver the Goods or Services.</p><p>2.8. \"Food Delivery\" is a reference to perishable goods and to any form of delivery service, which both are provided by our Participating Restaurants and for both of which our Participating Restaurants take full responsibility; and</p><p>2.9. \"Website\" is a reference to our Website http://www.flipbites.com or our mobile applications on which we offer our Goods or Services.</p><p><br></p><p>Section 3: Ordering</p><p>3.1. Any contract for the supply of Food Delivery from this Website is between you and the Participating Restaurant; for the supply of Goods or Services from this Website any contact is between you and flipbites. You agree to take particular care when providing us with your details and warrant that these details are accurate and complete at the time of ordering. You also warrant that the credit or debit card details that you provide are for your own credit or debit card and that you have sufficient funds to make the payment.</p><p>3.2. Food Delivery, Goods and Services purchased from this Website are intended for your use only and you warrant that any Goods purchased by you are not for resale and that you are acting as principal only and not as agent for another party when receiving the Services.</p><p>3.3. Please note that some of our Goods may be suitable for certain age ranges only. You should check that the product you are ordering is suitable for the intended recipient.</p><p>3.4. When ordering from this Website you may be required to provide an e-mail address and password. You must ensure that you keep the combination of these details secure and do not provide this information to a third party.</p><p>3.5. We will take all reasonable care, in so far as it is in our power to do so, to keep the details of your order and payment secure, but in the absence of negligence on our part we cannot be held liable for any loss you may suffer if a third party procures unauthorized access to any data you provide when accessing or ordering from the Website.</p><p>3.6. Any order that you place with us is subject to product availability, delivery capacity and acceptance by us and the Participating Restaurant. When you place your order online, we will send you an email to confirm that we have received it. This email confirmation will be produced automatically so that you have confirmation of your order details. You must inform us immediately if any details are incorrect. The fact that you receive an automatic confirmation does not necessarily mean that either we or the Participating Restaurant will be able to fill your order. Once we have sent the confirmation email we will check availability and delivery capacity.</p><p>3.7. If the ordered Food Delivery and delivery capacity is available, the Participating Restaurant will accept the contract and confirm it to flipbites. If the details of the order are correct, the contract for the Food Delivery, Goods or Services will be confirmed by text message (SMS).</p><p>3.8. In the case that Goods offered by flipbites were ordered, flipbites will confirm availability together with or separately from Food Delivery.</p><p>3.9. The confirmation message will specify delivery details including the approximate delivery time specified by the Participating Restaurant and confirm the price of the Food Delivery, Goods and Services ordered.</p><p>3.10. If the Food Delivery and/or Goods are not available or if there is no delivery capacity, we will also let you know by text message (SMS) or phone call.</p><p><br></p><p>Section 4: Prices and Payment</p><p>4.1. Any contract for the supply of Food Delivery from this Website is between you and the Participating Restaurant; for the supply of Goods or Services from this Website any contact is between you and flipbites. You agree to take particular care when providing us with your details and warrant that these details are accurate and complete at the time of ordering. You also warrant that the credit or debit card details that you provide are for your own credit or debit card and that you have sufficient funds to make the payment.</p><p>4.2. All prices listed on the Website are correct at the time of publication and have been input as received by the restaurant; &nbsp;While we give great care to keep them up to date, the final price charged to you by the restaurant can change at the time of delivery based on the latest menu and prices of the restaurant. . We also reserve the right to alter the Goods or Services available for sale on the Website and to stop listing restaurants, Goods or Services.</p><p>4.3. All prices listed on the Website for Food Delivery by the Participating Restaurant or a delivery partner listed on the Website reflect the price the Participating Restaurant or the third party provider charges at the time of listing. In case the price listed is not current and the restaurant informs us immediately after placing the order, we will put our best effort to contact you to inform you about the price difference and you can choose to opt-out of the order at that time.</p><p>4.4. All prices for delivery by flipbites or a third party provider assigned by flipbites listed on the Website are correct at the time of publication, however, we reserve the right to alter these in the future</p><p>4.5. The total price for Food Delivery, Goods or Services ordered, including delivery charges and other charges, will be displayed on the Website when you place your order. Full payment must be made for all Goods despatched and Services provided. Payment has to be made in cash or, if available on the website, by online payment, e.g. credit or debit card.</p><p>4.6. If you choose online payment, you must pay for your order before it is delivered. To ensure that shopping online is secure, your debit/credit card details will be encrypted to prevent the possibility of someone being able to read them as they are sent over the internet. Your credit card company may also conduct security checks to confirm it is you placing the order.</p><p><br></p><p>Section 5: Delivery</p><p>5.1. Delivery periods quoted at the time of ordering are approximate only and may vary. Goods will be delivered to the address designated by you at the time of ordering.</p><p>5.2. If delivery is done by the Participating Restaurant or its delivery partners, it is the Participating Restaurants sole responsibility to provide Food Delivery in a timely manner.</p><p>5.3. In the case delivery is done by flipbites or a third party delivery partner assigned by flipbites, we will give great care to deliver in a timely manner. No responsibility is taken for late delivery by flipbites in either case.</p><p>5.4. All orders are delivered by a reputable courier. We and the Participating Restaurant will make every effort to deliver within the time stated, however, we will not be liable for any loss caused to you by ordering late. If the Goods are not delivered within the estimated delivery time quoted by us, please contact the participating restaurant first. You may also contact us by telephone or email and we will try to ensure that you receive your order as quickly as possible.</p><p>5.5. In case of a late delivery, the delivery charge will neither be voided nor refunded by flipbites.</p><p>5.6. All risk in the Goods and the Food Delivery shall pass to you upon delivery.</p><p>5.7. If you mail to accept delivery of Food Delivery and/or Goods at the time they are ready for delivery, or we are unable to deliver at the nominated time due to your failure to provide appropriate instructions, or authorizations, then such goods shall be deemed to have been delivered to you and all risk and responsibility in relation to such goods shall pass to you. Any storage, insurance and other costs which we incur as a result of the inability to deliver shall be your responsibility and you shall indemnify us in full for such cost.</p><p>5.8. You must ensure that at the time of delivery of Food Delivery and/or Goods adequate arrangements, including access where necessary, are in place for the safe delivery of such goods. We cannot be held liable for any damage, cost or expense incurred to such goods or premises where this arises as a result of a failure to provide adequate access or arrangements for delivery.</p><p>5.9. Participating restaurants, who will prepare your order, aim</p><p>5.9.1. to deliver the product to you at the place of delivery requested by you in your order;</p><p>5.9.2. to deliver within the time confirmed by the restaurant;</p><p>5.9.3. to inform you if they expect that they are unable to meet the estimated delivery time.</p><p>5.10. Participating Restaurants and we shall not be liable to you for any losses, liabilities, costs, damages, charges or expenses arising out of late delivery;</p><p>5.11. Please note that it might not be possible for Participating Restaurants to deliver to some locations. If this is the case, our Participating Restaurants or we will inform you using the contact details that you provide to us when you make your order and arrange for cancellation of the order or delivery to an alternative delivery address;</p><p><br></p><p>Section 6: Cancellation</p><p>6.1. You must notify the participating restaurant immediately if you decide to cancel your order, preferably by phone, and quote your order number. If the restaurant accepts your cancellation, no cancellation fee applies. If the restaurant refuses cancellation, e.g. because preparation of Food Delivery has been completed and/or delivery personnel has already been dispatched, it may not be cancelled. We will not be able to refund any order, which has been already dispatched.</p><p>6.2. We may cancel a contract if the product is not available for any reason. We will notify you if this is the case and return any payment that you have made;</p><p>6.3. If the cancellation was made in time and once the restaurant has accepted your cancellation, we will refund or re-credit your debit or credit card with the full amount within 14 days, which includes the initial delivery charge (where applicable) which you paid for the delivery of the Goods or the Services, as applicable.</p><p>6.4. In the unlikely event that the Participating Restaurant delivers a wrong item, you have the right to reject the delivery of the wrong item and you shall be fully refunded for the missing item. If the Participating Restaurant can only do a partial delivery (a few items might be not available), its staff should inform you or propose a replacement for missing items. You have the right to refuse a partial order before delivery and get a refund. We are not responsible for wrong or partial delivery. The issue has to be settled directly with the Participating Restaurant.</p><p><br></p><p>Section 7: Information</p><p>7.1. Where we have requested information from you to provide Food Delivery, Goods or Services you agree to provide us with accurate and complete information.</p><p>7.2. You authorize us to use, store or otherwise process your personal information in order to provide the Food Delivery, Goods or Services to you and for marketing and credit control purposes (the \"Purpose\"). The Purpose may include the disclosure of your personal information to selected third parties from time to time where we believe that the services offered by such third parties may be of interest to you or where this is required by law or in order to provide the Food Delivery, Goods or Service to you. More information can be found in our Privacy Policy.</p><p>7.3. You are entitled to request a copy of the personal information we hold on you. Please contact us if you wish to request this information.</p><p><br></p><p>Section 8: Linked Sites There may be a number of links on our Website to third party Websites which we believe may be of interest to you. We do not represent the quality of the Goods or Services provided by such third parties nor do we have any control over the content or availability of such sites. We cannot accept any responsibility for the content of third party Websites or the Services or Goods that they may provide to you.</p><p><br></p><p>Section 9: Complaints We take complaints very seriously and aim to respond to your complaints within 5 business days. All complaints should be addressed tosupport@flipbites.com</p><p><br></p><p>Section 10: Limitation of Liability</p><p>10.1. Great care has been taken to ensure that the information available on this Website is correct and error free. We apologize for any errors or omissions that may have occurred. We cannot warrant that use of the Website will be error free or fit for purpose, timely, that defects will be corrected, or that the site or the server that makes it available are free of viruses or bugs or represents the full functionality, accuracy, reliability of the Website and we do not make any warranty whatsoever, whether express or implied, relating to fitness for purpose, or accuracy.</p><p>10.2. By accepting these terms of use you agree to relieve us from any liability whatsoever arising from your use of information from any third party, or your use of any third party website, or your consumption of any food or beverages from a Participating Restaurant.</p><p>10.3. We disclaim any and all liability to you for the supply of the Food Delivery, Goods and Services to the fullest extent permissible under applicable law. This does not affect your statutory rights as a consumer. If we are found liable for any loss or damage to you such liability is limited to the amount you have paid for the relevant Goods or Services. We cannot accept any liability for any loss, damage or expense, including any direct or indirect loss such as loss of profits to you, howsoever arising. This limitation of liability does not apply to personal injury or death arising as a direct result of our negligence.</p><p>10.4. We do not accept any liability for any delays, failures, errors or omissions or loss of transmitted information, viruses or other contamination or destructive properties transmitted to you or your computer system via our Website.</p><p>10.5. We shall not be held liable for any failure or delay in performing Services or delivering Goods where such failure arises as a result of any act or omission, which is outside our reasonable control such as all overwhelming and unpreventable events caused directly and exclusively by forces of nature that can be neither anticipated, nor controlled, nor prevented by the exercise of prudence, diligence, and care, including but not limited to: war, riot, civil commotion; compliance with any law or governmental order, rule, regulation or direction and acts of third parties.</p><p>10.6. If we have contracted to provide identical or similar order to more than one Customer and are prevented from fully meeting our obligations to you by reason of an Event of Force Majeure, we may decide at our absolute discretion which orders we will fill and to what extent.</p><p>10.7. The products sold by us are provided for private domestic and consumer use only. Accordingly, we do not accept liability for any indirect loss, consequential loss, loss of data, loss of income or profit, loss of damage to property and/or loss from claims of third parties arising out of the use of the Website or for any products or services purchased from us.</p><p>10.8. We have taken all reasonable steps to prevent Internet fraud and ensure any data collected from you is stored as securely and safely as possible. However, we cannot be held liable in the extremely unlikely event of a breach in our secure computer servers or those of third parties.</p><p>10.9. In the event flipbites has a reasonable belief that there exists an abuse of vouchers and/or discount codes or in suspected instances of fraud, flipbites may cause the shopper (or customer) to be blocked immediately and reserves the right to refuse future service. Additionally, should there exist an abuse of vouchers or discount codes, flipbites reserves the right to seek compensation from any and all violators.</p><p>10.10. Offers are subject to Flipbitesâ€™ discretion and may be withdrawn at any time and without notice.</p><p><br></p><p>Section 11: General</p><p>11.1. All prices are in India Dollars. GST is included where indicated</p><p>11.2. We may subcontract any part or parts of the Services or Goods that we provide to you from time to time and we may assign or novate any part or parts of our rights under these Terms and Conditions without your consent or any requirement to notify you.</p><p>11.3. We may alter or vary the Terms and Conditions at any time without notice to you.</p><p>11.4. Payment must be made either at the time of ordering the Food Delivery, Goods or Services from us by credit card or at the time of delivery by cash. Failure to pay on time will result in the cancellation of your order.</p><p>11.5. Do not use or launch any automated system or program in connection with our website or its online ordering functionality;</p><p>11.6. Do not collect or harvest any personally identifiable information from the website, use communication systems provided by the website for any commercial solicitation purposes, solicit for any reason whatsoever any users of the website with respect to their submissions to the website, or publish or distribute any vouchers or codes in connection with the website, or scrape or hack the website.</p><p>11.7. The Terms and Conditions together with the Privacy Policy, any order form and payment instructions constitute the entire agreement between you and us. No other terms whether expressed or implied shall form part of this Agreement. In the event of any conflict between these Terms and Conditions and any other term or provision on the Website, these Terms and Conditions shall prevail.</p><p>11.8. If any term or condition of our Agreement shall be deemed invalid, illegal or unenforceable, the parties hereby agree that such term or condition shall be deemed to be deleted and the remainder of the Agreement shall continue in force without such term or condition.</p><p>11.9. These Terms and Conditions and our Agreement shall be governed by and construed in accordance with the laws of India. The parties hereto submit to the exclusive jurisdiction of the courts of India.</p><p>11.10. No delay or failure on our part to enforce our rights or remedies under the Agreement shall constitute a waiver on our part of such rights or remedies unless such waiver is confirmed in writing.</p><p>11.11. These Terms and Conditions and a contract (and all non-contractual obligations arising out of or connected to them) shall be governed and construed in accordance with India Laws. Both we and you hereby submit to the non-exclusive jurisdiction of the India Courts. All dealings, correspondence and contacts between us shall be made or conducted in the English language.</p>', 'Publish', '2014-01-06 09:13:32', '2015-10-01 15:34:16', '', ''),
(4, 'Privacy Policy', 'privacy_policy', '', '\r\n<p>This policy explains how we, Flipbites, a brand of <strong>Digi Labs OnlineServices Pvt. Ltd,</strong> use your personal information which you provide to us when using our service, including but not limited to our website and mobile applications (apps).</p>\r\n\r\n<h3>What information we collect about you? </h3>\r\n<p>We collect personal information from you when you order goods or services from us or use our website. We also collect information when you complete any customer survey. Website usage information may also be collected using cookies.</p>\r\n\r\n<h3>Cookies and Google Analytics </h3>\r\n<p>Cookies are small text files that are placed on your computer by websites that you visit. They are widely used in order to make websites work, or work more efficiently, as well as to provide information to the owners of the site.</p>\r\n<p>This website uses Google Analytics, a web analytics service provided by Google,Inc. (\"Google\"). Google Analytics uses \"cookies\", which are text files saved on your computer, to help the website analyze how you use the site. The information generated by the cookie about your use of the website will be transmitted to and stored by Google on servers in the United States. If this website anonymizes IP addresses, your IP address will be truncated by Google within a EU member state or other EEA state before being transmitted to the US. Only in exceptional situations will your full IP address be transmitted to Google servers in the United States and truncated there. Google will use this information for the purpose of evaluating your use of the website,compiling reports on website activity for website operators and providing other services relating to website activity and internet usage. Google will not associate your IP address with any other data held by Google. You may refuse the use of cookies by selecting the appropriate settings on your browser,however please note that if you do this you may not be able to use the full functionality of this website. By using this website, you consent to the processing of data about you by Google in the manner and for the purposes set out above. You can also prevent Google from collecting information (including your IP address) via cookies and processing this information by downloading this browser plugin and installing it: https://tools.google.com/dlpage/gaoptout\r\n</p>\r\n<p>Most web browsers allow some control of most cookies through the browser settings. To find out more about cookies, including how to see what cookies have been set and how to manage and delete them, visit www.allaboutcookies.org.</p>\r\n\r\n<h3>How will we use the information we collect from you? </h3>\r\n\r\n<p>Information that we collect from you is used to process your order and to manage your account. We may also use your information to email you about other products or services that we think may be of interest to you.</p>\r\n<p>In processing your order we may send your information to credit reference and fraud prevention agencies.</p>\r\n\r\n<p>From time to time we may send your information to third parties which we consider may have goods or services which are of interest to you. If you do not wish to be contacted by third parties please email us at info@flipbites.com\r\n</p>\r\n\r\n<h3>Access to your information </h3>\r\n<p>You have a right to request a copy of the information we hold on you at anytime. Please email us if you would like to receive a copy of this information info@flipbites.com.There will be a small charge for processing this request.</p>\r\n\r\n<h3>Other Websites </h3>\r\n<p>Our website may have links to other websites. This privacy policy only applies to this website. You should therefore read the privacy policies of the other websites when you are using those sites.</p>\r\n\r\n', 'Publish', '2014-02-12 13:25:07', '2015-10-01 23:17:07', '', ''),
