(34, 'Mushroom Kebab Tikka', 'Mushroom Tikka Kebab is extremely delicious kebab recipe made with button mushrooms, veggies and then combined in special curd marination. It is an authentic tandoori style kebab preparation which has the soft touch of Indian spices and tandoori masala. It is a great delicious dish to serve if you are arranging a barbeque party. Learn to make soft and juicy chunks of mushroom marinated in the unique preparation and then grilled with the veggies.', 135.00, 75.00, NULL, 1, 3, '2015-09-16 12:20:24', '2015-09-29 21:59:05', 1, 1, 0),
